import { useEffect, useState, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { 
  usersList,
  sessionsList,
  sessionsSummary
} from '../../services/api';
import { 
  IconUsers as UsersIcon, 
  IconCalendar as CalendarIcon, 
  IconTools as ToolsIcon, 
  IconFeedback as FeedbackIcon, 
  IconEye as ActivityIcon,
  IconRefresh as RefreshIcon,
  IconSearch as SearchIcon,
  IconArrowRight as ArrowRightIcon
} from '../../components/Icons';
import '../../styles/dashboard.css';

// Helper function to format relative time
const formatRelativeTime = (dateString) => {
  const date = new Date(dateString);
  const now = new Date();
  const diffInSeconds = Math.floor((now - date) / 1000);

  if (diffInSeconds < 60) return 'just now';
  if (diffInSeconds < 3600) return `${Math.floor(diffInSeconds / 60)} mins ago`;
  if (diffInSeconds < 86400) return `${Math.floor(diffInSeconds / 3600)} hours ago`;
  if (diffInSeconds < 604800) return `${Math.floor(diffInSeconds / 86400)} days ago`;
  return date.toLocaleDateString();
};

const MetricCard = ({ icon, title, value = 0, change, isIncrease }) => (
  <div className="metric-card">
    <div className="metric-icon">{icon}</div>
    <div className="metric-content">
      <div className="metric-title">{title}</div>
      <div className="metric-value">
        {typeof value === 'number' ? value.toLocaleString() : '0'}
      </div>
      {change !== undefined && (
        <div className={`metric-change ${isIncrease ? 'increase' : 'decrease'}`}>
          {isIncrease ? 'â†‘' : 'â†“'} {change}% from last month
        </div>
      )}
    </div>
  </div>
);

export default function AdminDashboard() {
  const [metrics, setMetrics] = useState({
    totalUsers: 0,
    activeSessions: 0,
    totalSessions: 0,
    totalBookings: 0,
    totalTools: 0,
  });

  const [recentSessions, setRecentSessions] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchDashboardData = useCallback(async () => {
    try {
      setLoading(true);

      // Fetch all data in parallel
      const [usersResponse, sessionsResponse, summaryResponse] = await Promise.all([
        usersList().catch(() => ({ users: [] })),
        sessionsList({ page: 1, pageSize: 5, status: 'active' }).catch(() => ({ items: [] })),
        sessionsSummary().catch(() => ({ active: 0, total: 0 }))
      ]);

      const users = usersResponse.users || [];
      const sessions = sessionsResponse.items || [];
      const summary = summaryResponse || {};

      // Update metrics with fallback to 0 for all values
      setMetrics({
        totalUsers: users?.length || 0,
        activeSessions: summary?.active || 0,
        totalSessions: summary?.total || 0,
        totalBookings: 0, // You'll need to implement this if needed
        totalTools: 0,    // You'll need to implement this if needed
      });

      // Format recent sessions with proper user identification
      const formattedSessions = sessions.map(session => {
        // Get user details
        const userId = session.user?._id || session.userId;
        let displayName = 'System';

        // Determine role - prioritize admin status
        let role = 'member';
        if (session.user?.role === 'admin' || session.role === 'admin' || session.user?.isAdmin) {
          role = 'admin';
        } else if (session.user?.role === 'manager' || session.role === 'manager') {
          role = 'manager';
        }

        // Set display name based on role and available info
        if (role === 'admin') {
          displayName = `ðŸ‘‘ ${session.user?.name || session.user?.email?.split('@')[0] || 'Admin'}`;
        } else if (role === 'manager') {
          displayName = `ðŸ‘” ${session.user?.name || session.user?.email?.split('@')[0] || 'Manager'}`;
        } else {
          displayName = `ðŸ‘¤ ${session.user?.name || session.user?.email?.split('@')[0] || 'User'}`;
        }

        // Calculate if session is active (last activity within last 15 minutes)
        const lastActive = session.lastActive ? new Date(session.lastActive) : new Date();
        const fifteenMinutesAgo = new Date(Date.now() - 15 * 60 * 1000);
        const isActive = lastActive > fifteenMinutesAgo || session.status === 'active';

        return {
          id: session._id,
          user: displayName, // Use the display name we prepared
          time: formatRelativeTime(session.lastActive || session.createdAt || new Date()),
          status: isActive ? 'active' : 'offline',
          role: role,
          lastActive: lastActive,
          rawStatus: session.status // Keep original status for debugging
        };
      });

      setRecentSessions(formattedSessions);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchDashboardData();
  }, [fetchDashboardData]);

  const handleRefresh = () => {
    fetchDashboardData();
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Dashboard</h1>
      </div>

      <div className="metrics-grid">
        <MetricCard 
          icon={<UsersIcon size={24} />} 
          title="Total Users" 
          value={metrics.totalUsers} 
        />
        <MetricCard 
          icon={<ActivityIcon size={24} />} 
          title="Active Sessions" 
          value={metrics.activeSessions}
        />
        <MetricCard 
          icon={<CalendarIcon size={24} />} 
          title="Total Sessions" 
          value={metrics.totalSessions}
        />
        <MetricCard 
          icon={<ToolsIcon size={24} />} 
          title="Active Now" 
          value={metrics.activeSessions}
        />
      </div>

      <div className="dashboard-section">
        <div className="section-header">
          <h2>Recent Activity</h2>
          <button className="btn-text">
            <RefreshIcon size={16} onClick={handleRefresh} style={{ cursor: 'pointer' }} /> Refresh
          </button>
        </div>
        <div className="card">
          <table className="dashboard-table">
            <thead>
              <tr>
                <th>User</th>
                <th>Activity</th>
                <th>Time</th>
                <th>Status</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {recentSessions.map((session) => (
                <tr key={session.id}>
                  <td className="font-medium">
                    {session.user}
                    <div className="text-xs text-gray-500 mt-1">
                      {session.role === 'admin' ? 'Administrator' : 
                       session.role === 'manager' ? 'Manager' : 'Member'}
                    </div>
                  </td>
                  <td>{session.role === 'admin' ? 'Admin session' : 'User session'}</td>
                  <td title={session.lastActive?.toLocaleString() || ''}>
                    {session.time}
                  </td>
                  <td>
                    <span className={`status-badge ${session.status}`}>
                      {session.status === 'active' ? 'Active Now' : 'Offline'}
                      {session.status === 'active' && (
                        <span className="pulse-dot"></span>
                      )}
                    </span>
                  </td>
                  <td>
                    <button className="btn-text">View</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      <div className="dashboard-section">
        <div className="section-header">
          <h2>Sessions Overview</h2>
          <div className="time-filter">
            <button className="btn-text active">Today</button>
            <button className="btn-text">Week</button>
            <button className="btn-text">Month</button>
          </div>
        </div>
        <div className="sessions-chart">
          <div className="chart-placeholder">
            <p>Sessions chart will be displayed here</p>
          </div>
        </div>
      </div>
    </div>
  );
